import './App.css';
import  React from "react"

import Header from"./Sectionfiles/Header"
import Nav from "./Sectionfiles/Nav"
import Main from "./Sectionfiles/Main"
import Footer from "./Sectionfiles/Footer"

function App() {
  return (
    <main class="grid-container">
      <div class = "grid-item">
      <Nav></Nav>
      </div>
      <div class ="grid-item">
      <Main></Main>
      </div>
      <div class ="grid-item">
      <Footer></Footer>
      </div>
    </main>

  );
}

export default App;
